webpackJsonp([0x5f4ab8d078e1],{484:function(e,t){e.exports={data:{markdownRemark:{html:'<p>First, I want to know the flow of material.\nHow can I know that?\nIt is hard to imagine that unified data is somewhere.\nI think that there is no other way than collecting and integrating fragmentary data.</p>\n<p>What do I target? How can I do it?</p>\n<p>In the first place, what does the term "material" mean?</p>\n<p>Probably it will be mined from somewhere.\nIt start from there.</p>\n<p>And it is Transported somewhere.\nIt is processed at the factory and it become parts and raw materials.</p>\n<p>Oh, surely I\'m imaging a mineral (or crystal).\nOf course, it may be water, oil, or plants.\nIn the case of agriculture and stock raising, it will be also require its resource.</p>\n<p>It become product of something, and consumed by people (or machines).\nIt may be a product as a product part in the process.</p>\n<p>And eventually it will be scrapped.</p>\n<p>* * * * * * * * * *</p>\n<p>So, the perspective of the flow will roughly be as below.</p>\n<ul>\n<li>\n<p>To excavate (grow)<br>\nWhere does it come from?</p>\n</li>\n<li>\n<p>To build (make)<br>\nWhat will it be?</p>\n</li>\n<li>\n<p>To consume (use)<br>\nWhy is it necessary?</p>\n</li>\n<li>\n<p>To discard (scrap)<br>\nAnd Where will it go?</p>\n</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/flow1-e1dc843f96604bb34568cf697953bd9b-08e25.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 300px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 150%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="flow"\n        title=""\n        src="/static/flow1-e1dc843f96604bb34568cf697953bd9b-08e25.png"\n        srcset="/static/flow1-e1dc843f96604bb34568cf697953bd9b-08e25.png 300w"\n        sizes="(max-width: 300px) 100vw, 300px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',timeToRead:1,excerpt:"First, I want to know the flow of material.\nHow can I know that?\nIt is hard to imagine that unified data is somewhere.\nI think that there isâ€¦",frontmatter:{title:"Thinking about the material cycle",cover:"https://unsplash.it/800/600/?random?flow",date:"2018-04-27",category:"Flow",tags:["material"]},fields:{nextTitle:null,nextSlug:null,prevTitle:null,prevSlug:null,slug:"/thinking-about-the-material-cycle"}}},pathContext:{slug:"/thinking-about-the-material-cycle"}}}});
